var sel=function sel(a,b){if(!b){b=document}
if(b.querySelector(a)){return b.querySelector(a)}else{console.log('i cant find '+a)}};var all=function all(a,b){if(!b){b=document}
if(b.querySelectorAll(a).length===0){console.log('i cant find '+a)}else{return b.querySelectorAll(a)}};var addEvt=function addEvt(a,b,c){if(typeof a==='string'){a=all(a);a.forEach(function(e){e.addEventListener(b,c)})}else if(Object.prototype.toString.call(a)==='[object NodeList]'){a.forEach(function(e){e.addEventListener(b,c)})}else if(Array.isArray(a)){a.forEach(function(e){all(e).forEach(function(el){el.addEventListener(b,c)})})}else{a.addEventListener(b,c)}};var loaded=function loaded(a){addEvt(document,'DOMContentLoaded',a)}